import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="bg-red-500 px-6 py-4 flex justify-between items-center shadow-md">
      {/* Logo / Home */}
      <Link to="/" className="text-white text-2xl font-bold">
        üçï Pizza Delivery
      </Link>

      {/* Links */}
      <div className="flex items-center space-x-6">
        <Link to="/cart" className="text-white hover:underline">
          Cart
        </Link>

        {/* Auth Buttons */}
        <Link
          to="/login"
          className="bg-white text-red-500 px-4 py-2 rounded-lg font-semibold hover:bg-gray-100"
        >
          Login
        </Link>
        <Link
          to="/register"
          className="bg-yellow-400 text-black px-4 py-2 rounded-lg font-semibold hover:bg-yellow-300"
        >
          Register
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
